import React from "react";
import Hero_img from "./hero-img";

const Herosection = () => {
  return (
    <>
      <div className="main-page">
        <div className="hero-des">
          
          <div className="hero-buttons">

          </div>
        </div>
        <Hero_img />
      </div>
    </>
  );
};

export default Herosection;
